import { Navigate, Outlet } from "react-router-dom";

const PrivateRoute = ({ children, ...rest }) => {
    const auth = false
  return <Outlet {...rest}>{!auth ? <Navigate to={''}/> :children}</Outlet>;
};

export default PrivateRoute;
